css:
@-moz-document domain("www.youtube.com") {
  div#page{
    background-color: rgb(51, 50, 50) !important;
  }
  div#watch7-sidebar-contents, div#watch-header{
    background-color: rgb(58, 58, 58) !important;
    color: white !important;
  }
  div#watch7-sidebar-contents .title, div#watch7-sidebar-contents .watch-sidebar-head{
    color: white !important;
  }
  .yt-badge{
    color: rgb(43, 159, 255) !important;
    border: none !important;
  }
  .g-hovercard{
    color: rgb(214, 214, 214) !important;
  }
  div#watch-header .watch-view-count{
    color: white !important;
  }
  #action-panel-details, #watch-discussion{
    background-color: rgb(58, 58, 58) !important;
    color: white !important;
  }
  #action-panel-details *, #watch-discussion *{
    background-color: rgb(58, 58, 58) !important;
    color: white !important;
  }
}
